import React from 'react';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';

import { TextField } from '@mui/material';

const Signup = () => {

  return (
    <div>
       <Box
      sx={{
        display: 'flex',
        flexWrap: 'wrap',
        '& > :not(style)': {
          m: 1,
          width: 128,
          height: 128,
        },
      }}
    >
      <form>
      <TextField
        label="Email"
        variant="filled"
        type="email"
        required
      />
      </form>
    </Box>

    </div>
  );
}

export default Signup;
